//SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "./ShareSecret.sol";
//secretHolder 
contract PublicContract {

    //Request type to add as a share holder
    struct AddHolderRequest{
        address secretOwner;
        address shareHolder;
    }

    //namesTo Nodes Map
    mapping(string => Node) public nodesMap;

    //allNodes list
    AddHolderRequest[] holderRequests;

    function getAddress(string memory name) public view returns(Node){
        return nodesMap[name];
    }
    function register(string memory name,Node node)public {
        nodesMap[name]=node;
        return;
    }
    function notifyShareHolders(string memory name)public {
        Node myNode= nodesMap[name];
        myNode.askingFromHolders();
        return;
    }
    function regenerateSecret(string memory name)public view returns (string[] memory){
        Node myNode= nodesMap[name];
        string[] memory shares_new=myNode.regenerate();
        return shares_new;
    }
    function checkRequestsByShareholder(address owner)public view returns(address[] memory ) {
        address[] memory secretOwnerAddresses;
        uint256 i = 0;
        for (i; i<holderRequests.length; i++){
            AddHolderRequest memory request= holderRequests[i];
            if (request.shareHolder==owner){
              // secretOwnerAddresses.push(request.secretOwner);
            }

        }
     return secretOwnerAddresses;
    }


    
}

